  [],\n\t\"revision_timestamp\": \"2015-05-07T01:32:10.247910\",\n\t\"name\": \"authentication-for-propulsion-test-streaming-video-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;An application was developed that
  could enforce two-factor authentication for NASA access to the Propulsion Test Streaming
  Video System.&amp;nbsp; To gain access to the Propulsion Test Streaming Video System,
  all user requests are submitted through the NASA Account Management System (NAMS).&amp;nbsp;
  The assigned approver of these requests is the respective Project Manager for each
  of the engine test projects.&amp;nbsp; Then, for authentication purposes, a user
  is required to use either a NASA issued SmartCard or RSA token to gain access to
  the website.&amp;nbsp; Upon authentication, the user enters the website page. The
  page displays hyperlinks to each engine test video streams that the user has been
  granted access to.&amp;nbsp; The user can then selects the chosen video stream for
  live viewing from their end-user device/location.&amp;nbsp; For commercial customers,
  the video stream is sent directly from the video encoder to the customer&amp;rsquo;s
  corporate streaming server for distribution within the customer&amp;rsquo;s facility.&lt;/p&gt;&lt;p&gt;The
  architecture of the Propulsion Test Streaming Video System was redesigned in order
  to provide a service capable of supporting two-factor authentication.&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;\",\n\t\"license_title\":
